cd /Users/audrainsp/Library/CloudStorage/OneDrive-NationalInstitutesofHealth/BabyHippos/R_BabyHippos/GitHub

individualClust = table2array(readtable('clusters_leave1out_test.txt', 'Delimiter', ' '));

%%
originalClust = individualClust(:,1); %%% first column is cluster labels
individualClust = individualClust(:,2:end); %%% the rest are clustering solutions from leave-one out clustering

adjMat = zeros(size(individualClust,1));

for i=1:size(individualClust,2)
    for ii=1:size(individualClust,1)
        for iii=1:size(individualClust,1)

            if individualClust(ii,i)==individualClust(iii,i)
                adjMat(ii,iii) = adjMat(ii,iii)+1;
            end

        end

    end
end

adjMat = adjMat/size(individualClust,2);

forDisp = [adjMat zeros(length(adjMat),1)];
forDisp = [forDisp; zeros(1,length(adjMat)+1)];
figure
surf(forDisp);

threshMat = 1.0*(adjMat==1.0);

[Y,I]=sort(originalClust);

% This is the continuous-valued adjacency matrix, sorted by original clust
forDisp = [adjMat(I,I) zeros(length(adjMat),1)];
forDisp = [forDisp; zeros(1,length(adjMat)+1)];
figure
surf(forDisp);

% This is the perfect consistency adjacency matrix, sorted by original clust
forDisp = [threshMat(I,I) zeros(length(adjMat),1)];
forDisp = [forDisp; zeros(1,length(adjMat)+1)];
figure
surf(forDisp);

%%
% adjMat is the continuous-valued square matrix
% threshMat is the 1/0 square matrix

csvwrite('threshMat_test.csv', threshMat)
csvwrite('adjMat_test.csv', adjMat)
